import './BurgerMenuPopup.css'
import { NavLink } from 'react-router-dom';

function BurgerMenuPopup() {
  return (
    <div className="burger-menu">
      <div className="burger-menu__wrapper">
        <button className="burger-menu__close-button"/>
        <nav className="burger-menu__navigation">
          <NavLink className="burger-menu__link">Главная</NavLink>
          <NavLink className="burger-menu__link">Фильмы</NavLink>
          <NavLink className="burger-menu__link">Сохранённые фильмы</NavLink>
        </nav>
        <NavLink>Аккаунт</NavLink>
      </div>
    </div>
  )
};

export default BurgerMenuPopup;
